import React from "react";

let questions = [
    {"Question": "Survey Question 1"},
    {"Question": "Survey Question 2"}
]


class Survey extends React.Component{
    static defaultProps = {
        questions : [
            {"Question": "Survey Question 1"},
            {"Question": "Survey Question 2"}
        ]
    }
    render(){
        const questions = this.props
        return(
            <div>
                <h1 className="header">Survey1</h1>
               
            </div>
        )
    }
}

export default Survey
